import React from 'react'

class CoreLogic extends React.Component{
    render(){
        let item = SidebarData.find(item => item.title === "CoreLogic Internship");
        return(
            <div className='corelogic'>
                <Banner 
                imageSrc = {item.imgSrc}
                thisIs = "my CoreLogic Internship"
                descript= "Panasonic Avionics Web Development Intern from October 2019 to April 2020. Unfortunately cut short due to the COVID-19 pandemic."
                />
            </div>
        )
    }
}

export default CoreLogic;
